import React from 'react';
import StockPopup from '../components/streams/StockPopup';
import { connect } from 'react-redux';
import { getStocks } from '../actions';

{/* <Popup trigger={<button>Buy Stocks</button>} position="right center">
<StockPopup/>
</Popup> */}
class Deposits extends React.Component{
  render(){
    return (
      <div>{this.props.companies}</div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    companies:state.stocks
  };
};

export default connect(
  mapStateToProps,
  { getStocks }
)(Deposits);
